import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [player, setPlayer] = useState("");

  return (
    <div className="App">
      <h1>League Stats</h1>
      <input type="text" onChange={e => setPlayer(e.target.value)}></input>
      <button>Search</button>
    </div>
  );
}

export default App;
